def calculate_min_time(n, m, k, a, b):
    a += 1
    b -= 1

    def get_entrance(x):
        return x // (m * k)

    def get_floor(x):
        return (x - get_entrance(x) * m * k) // k

    def floor_travel_time(x):
        return min(5 * x, 10 + x)
    entrance_a = get_entrance(a)
    entrance_b = get_entrance(b)
    floor_a = get_floor(a)
    floor_b = get_floor(b)
    if entrance_a == entrance_b:
        floor_difference = abs(floor_a - floor_b)
        return floor_travel_time(floor_difference)
    else:
        entrance_difference = min((entrance_a - entrance_b + n) % n, (entrance_b - entrance_a + n) % n)
        entrance_travel_time = 15 * entrance_difference
        time_to_ground_a = floor_travel_time(floor_a)
        time_to_floor_b = floor_travel_time(floor_b)
        return time_to_ground_a + entrance_travel_time + time_to_floor_b

